import React, { Component } from 'react';
import { Checkbox, InputLabel, Input, Grid, Button } from '@material-ui/core';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';

import {fetchBulkData} from './../util/api';
export default class History extends Component{
    constructor(props){
        super(props)
        this.setState={
            disable:false,
            metaData:[],
        }
        
    }
    loadData(){
        fetchBulkData().then((jsondata) => {
            var metaData=[]
            let result = JSON.parse(jsondata.data);
            var arrData = {}
            console.log("Bulk Meta Data : ",result)
            result[0].forEach((element ,id)=> {
                arrData=element
                // console.log(element)
                metaData=[
                    ...metaData,
                    {
                        "Reg Id":arrData.regId,
                        "File Name": arrData.uploadFileName,
                        "Center Name": arrData.centerName,
                        "Records":arrData.records,
                        "Upload Date":arrData.uploadDate
                    }]
            })
            this.setState({metaData })
            console.log(this.state.metaData)
        })
    }

    // Download the data
    saveFunderMappingDetails(){
        alert("Hello")
    }
    render(){
        return(
            <div style={{ width: '100%' }}>

            <Grid container  justify="flex-end" alignItems="flex-end">
             <Button type="submit" color="primary"  onClick={this.loadData.bind(this)}>
               Click to Load Data
             </Button>
             </Grid>

            <Grid>
             <Table aria-label="simple table">
            <TableHead>
              <TableRow>
                <TableCell>Reg Id</TableCell>
                <TableCell>File Name</TableCell>
                <TableCell>Center Name</TableCell>
                <TableCell>Records</TableCell>
                <TableCell>Upload Date</TableCell>

              </TableRow>
            </TableHead>
            <TableBody>
            {/* {this.state.metaData.map((dataValue, id) => (
                    <TableRow id="tablerow">
                      <TableCell>{dataValue.regId}</TableCell>
                      <TableCell>{dataValue.uploadFileName}</TableCell>
                      <TableCell>{dataValue.centerName}</TableCell>
                      <TableCell>{dataValue.records}</TableCell>
                      <TableCell>{dataValue.uploadDate}</TableCell>
                      <TableCell>{<Button variant="contained" color="primary" onClick={() => this.saveFunderMappingDetails()} > Download </Button>}</TableCell>
                    </TableRow>))} */}
            </TableBody>
           </Table>

           </Grid>
            </div>
        )
    }
}
